CHData.prototype.calcularMaxLCdWT = function (LCWT) {
  var sum = [];
  var maxLCdWT = [];
  var tam = this.matrizSumasChiller1Map(matricesChiller1map)[0].length - 1;
  this.matrizSumasChiller1Map(matricesChiller1map).forEach(function (valorActual, indice) {
    sum[indice] = valorActual[tam];
    maxLCdWT[indice] = LCdWTArray[sum[indice] - 1];
  });
  var maxLCWT = Math.max.apply(null, temperaturas.filter(function (valor) {
    return valor <= LCWT;
  }));
  return maxLCdWT[temperaturas.indexOf(maxLCWT)];
}

